features.script:
let door = parcel.getFeatureById('door_left') //porta esquerda
let door2 = parcel.getFeatureById('door_right')//porta direita

//animação de abrir porta esquerda
let a1 = door.createAnimation('position') 
a1.setKeys([{
    frame: 30,
    value: door.position.add(new Vector3(0, 0.1, -2.1)),  
}])

//animação de abrir porta direita
let a1_right = door2.createAnimation('position') 
a1_right.setKeys([{
    frame: 30,
    value: door2.position.add(new Vector3(0, -0.1, 2.15)),  
}])

let abrirInterval = 1
let fecharInterval = 1
let grudaInterval = 1
let animationRunning = false
//inicia animação de abrir com o click

door.on('trigger', e=>{
if(animationRunning == false){
    door.startAnimations([a1])
    door2.startAnimations([a1_right])
    abrirInterval = setInterval(startClose, 2000)
    animationRunning = true  
  }  
})

//functions
function startClose(){

  door.position.z = -2.35

  //animação de fechar porta esquerda
  let anim2 = door.createAnimation('position') 
  anim2.setKeys([{
    frame: 30,
    value: door.position.add(new Vector3(0, 0.1, 2.1)),  
  }])
  door.startAnimations([anim2])

  //animação de fechar porta direita
  door2.position.z = 2.95
  let anim2_right = door2.createAnimation('position') 
  anim2_right.setKeys([{
    frame: 30,
    value: door2.position.add(new Vector3(0, -0.1, -2.1)),  
  }])
  door2.startAnimations([anim2_right])
  fecharInterval = setInterval(closed, 1100)
  clearInterval(abrirInterval)
}

function closed(){
  animationRunning = false
  door.position.z = -0.2
  door2.position.z = 0.75
  door2.position.x = 11.15
  door2.position.y = 2.57
  console.log('closed')
  clearInterval(fecharInterval)
}
